BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Clientes" (
	"CLIENTE"	TEXT,
	"C.C Ó NIT"	TEXT,
	"TELÉFONO"	TEXT,
	"CELULAR"	TEXT,
	"DIRECCIÓN"	TEXT,
	"CIUDAD"	TEXT,
	"EDAD"	INTEGER,
	"CORREO"	TEXT,
	"DIRECCIÓN ENVÍO"	TEXT,
	PRIMARY KEY("C.C Ó NIT")
);
CREATE TABLE IF NOT EXISTS "Pedidos" (
	"ID_PEDIDO"	INTEGER,
	"C.C Ó NIT"	TEXT,
	"FECHA"	TEXT,
	"MONTO"	REAL,
	"PRODUCTO"	TEXT,
	PRIMARY KEY("ID_PEDIDO" AUTOINCREMENT),
	FOREIGN KEY("C.C Ó NIT") REFERENCES "Clientes"("C.C Ó NIT")
);
COMMIT;
